const Home=()=>{
    let backurl=`url("https://www.ionos.co.uk/digitalguide/fileadmin/DigitalGuide/Teaser/instagram-fuer-unternehmen-t.jpg")`;
    return (
        <div style={{width:"100vw" ,height:"100vh",opacity:"0.9" }}>
            <img src={backurl} style={{ width: "100%", height: "100%", objectFit: "cover" }} alt="Background" />

        </div>
    )
}
export default Home;
